import React from 'react';

export default function Header(props) {
    return (

    <header className="row block center" >
        <div>
            <a href="#/">
            <h1>Small Shopping cart</h1>
            </a>
        </div>
        <div>
            <a href="#/cart">Cart</a><br></br>
            <a href="#/signin">Signin</a>
        </div>
    </header>
        )
}
